import {BrowserRouter as Router,Routes, Route} from "react-router-dom";
import NewJoin from "./component/Join/NewJoin.js";

import {user} from "./component/Join/NewJoin.js";


function App() {

  return (
      <div className="App">
          <Router>
            <Routes>
              <Route exact path='/' element={< NewJoin />}></Route>  
              <Route exact path="/chat" element={user}/>
            </Routes>
          </Router>

      </div>
  );
}

export default App;
